import React from 'react'
import ReactDOM from 'react-dom'
import App from "./App" 
import "./index.css"
import Sdata from "./Sdata"



ReactDOM.render(
        <>
        <h1> Most Watched Netflix Webseries </h1>

         <App 
         imgsrc={Sdata[0].imgsrc}
         title={Sdata[0].title}
         sname= {Sdata[0].sname}
         link={Sdata[0].link} />

        <App 
        imgsrc={Sdata[1].imgsrc}
         title={Sdata[1].title}
         sname= {Sdata[1].sname}
         link={Sdata[1].link} /> 

        <App 
         imgsrc={Sdata[3].imgsrc}
         title={Sdata[3].title}
         sname= {Sdata[3].sname}
         link={Sdata[3].link} /> 


<App 
        imgsrc={Sdata[3].imgsrc}
        title={Sdata[3].title}
        sname= {Sdata[3].sname}
        link={Sdata[3].link} /> 

        <App 
         imgsrc={Sdata[4].imgsrc}
         title={Sdata[4].title}
         sname= {Sdata[4].sname}
         link={Sdata[4].link} /> 


        </>



, document.getElementById('root'))
